import React from 'react';
import '../styles/signin.css';
import Logo from '../assets/logo.png';
import {BrowserRouter as Router ,Route , Routes ,Link} from 'react-router-dom'; 
import Signin from '../pages/signin';
import Signup from './signup';
import Dashboard from './dashboard' ; 
function signin() {
  return (
    <form style={{ placeItems: "center" ,  height: '100%'}}>
    <div class="image-container">
     <img src={Logo} className="rounded-circle bg-outline-light logo" alt="Logo Chatbotyy"/></div>
     <br></br>
     <div class="col-lg-6 mb-4 " style={{marginLeft : '25%' , placeItems: "center"}}>
    </div>
  
    <div class="row mb-4" style={{ placeItems: "center"}}>
      <div class="col d-flex justify-content-center">
  
       
      
</div>
      
        
        <a href="#!" className="link text-light" style={{marginLeft : '20%'}}>Forgot password?</a>
      
    </div>
  
    <Link to ="/Dashboard">
    <button type="button" className="btn btn-outline-light btn-block mb-4">Sign in</button>
    </Link> 
    
  
   
    <div className="text-center text-white">
      <p>Not a member? <Link  to="/Signup" className="text-light" >Register Now </Link></p>
      <Routes>  
         <Route path='/Signup' element={<Signup/>}/> 
      </Routes>
 
       </div>
  </form>
        
  )
}

export default signin
